(23, 'Q', NULL, NULL, NULL, NULL, NULL, 2, 0, NULL, NULL, NULL, 2257257919876146499, 0xc0a80164, NULL, NULL, 0, 0, 0, 0xc0a80164, 1, 52472900000, 0, 'html', '2018-04-22 22:33:28', NULL, NULL, 'How to compare two results and rank them according to the number of matching numbers', '<p>I am a beginner with Python. I am making a lottery program. I have a problematic part and ask a question. First, before running the lottery program, I will set six variables. These variables are compared to six randomly selected numbers in the lottery program. I want to compare the two results and rank them according to the number of matches.</p><p>My Criteria for ranking is :</p><ul><li>1st : Match the 6 numbers.</li><li>2nd : 5 numbers match and one additional number matche.</li><li>3rd : Match the 5 numbers.</li><li>4th : Match the 4 numbers.</li><li>5th : Match the 3 numbers.</li></ul><p>But it did not work out as expected. I do not know what problem is wrong. Please let me know where the problem is. Please also tell me how to fix it. I hope I had the problem has been well explained.</p><p>Thank you in advance.</p><p></p><pre><span style="color:#858c93; font-family:inherit">## Variable declaration part ##</span><span style="color:#303336; font-family:inherit">\n</span><span style="color:#101094; font-family:inherit">print</span><span style="color:#303336; font-family:inherit">(</span><span style="color:#7d2727; font-family:inherit">"\\nPlease enter the 6 numbers you expected.."</span><span style="color:#303336; font-family:inherit">)</span><span style="color:#303336; font-family:inherit">\n</span><span style="color:#101094; font-family:inherit">print</span><span style="color:#303336; font-family:inherit">(</span><span style="color:#7d2727; font-family:inherit">"--------------------------------------------------------"</span><span style="color:#303336; font-family:inherit">)</span><span style="color:#303336; font-family:inherit">\n\n</span><span style="color:#101094; font-family:inherit">while</span><span style="color:#303336; font-family:inherit"> </span><span style="color:#101094; font-family:inherit">True</span><span style="color:#303336; font-family:inherit"> </span><span style="color:#303336; font-family:inherit">:</span><span style="color:#303336; font-family:inherit">\n    a </span><span style="color:#303336; font-family:inherit">=</span><span style="color:#303336; font-family:inherit"> int</span><span style="color:#303336; font-family:inherit">(</span><span style="color:#303336; font-family:inherit">input</span><span style="color:#303336; font-family:inherit">(</span><span style="color:#7d2727; font-family:inherit">"1st expected number : "</span><span style="color:#303336; font-family:inherit">))</span><span style="color:#303336; font-family:inherit">\n    </span><span style="color:#101094; font-family:inherit">if</span><span style="color:#303336; font-family:inherit"> a </span><span style="color:#303336; font-family:inherit">==</span><span style="color:#303336; font-family:inherit"> </span><span style="color:#7d2727; font-family:inherit">0</span><span style="color:#303336; font-family:inherit"> </span><span style="color:#303336; font-family:inherit">:</span><span style="color:#303336; font-family:inherit">\n        </span><span style="color:#101094; font-family:inherit">print</span><span style="color:#303336; font-family:inherit">(</span><span style="color:#7d2727; font-family:inherit">"0 is the excluded number. Please re-enter."</span><span style="color:#303336; font-family:inherit">)</span><span style="color:#303336; font-family:inherit">\n        </span><span style="color:#101094; font-family:inherit">continue</span><span style="color:#303336; font-family:inherit">\n    </span><span style="color:#101094; font-family:inherit">elif</span><span style="color:#303336; font-family:inherit"> a </span><span style="color:#303336; font-family:inherit">&lt;</span><span style="color:#303336; font-family:inherit"> </span><span style="color:#7d2727; font-family:inherit">46</span><span style="color:#303336; font-family:inherit"> </span><span style="color:#303336; font-family:inherit">:</span><span style="color:#303336; font-family:inherit">\n        </span><span style="color:#101094; font-family:inherit">break</span><span style="color:#303336; font-family:inherit">\n</span><span style="color:#101094; font-family:inherit">print</span><span style="color:#303336; font-family:inherit">(</span><span style="color:#7d2727; font-family:inherit">"Please enter a number from 1 to 45."</span><span style="color:#303336; font-family:inherit">)</span><span style="color:#303336; font-family:inherit">\n\n</span><span style="color:#101094; font-family:inherit">while</span><span style="color:#303336; font-family:inherit"> </span><span style="color:#101094; font-family:inherit">True</span><span style="color:#303336; font-family:inherit"> </span><span style="color:#303336; font-family:inherit">:</span><span style="color:#303336; font-family:inherit">\n    b </span><span style="color:#303336; font-family:inherit">=</span><span style="color:#303336; font-family:inherit"> int</span><span style="color:#303336; font-family:inherit">(</span><span style="color:#303336; font-family:inherit">input</span><span style="color:#303336; font-family:inherit">(</span><span style="color:#7d2727; font-family:inherit">"\\2nd expected number : "</span><span style="color:#303336; font-family:inherit">))</span><span style="color:#303336; font-family:inherit">\n    </span><span style="color:#101094; font-family:inherit">if</span><span style="color:#303336; font-family:inherit"> b </span><span style="color:#303336; font-family:inherit">==</span><span style="color:#303336; font-family:inherit"> </span><span style="color:#7d2727; font-family:inherit">0</span><span style="color:#303336; font-family:inherit"> </span><span style="color:#303336; font-family:inherit">:</span><span style="color:#303336; font-family:inherit">\n        </span><span style="color:#101094; font-family:inherit">print</span><span style="color:#303336; font-family:inherit">(</span><span style="color:#7d2727; font-family:inherit">"0 is the excluded number. Please re-enter."</span><span style="color:#303336; font-family:inherit">)</span><span style="color:#303336; font-family:inherit">\n        </span><span style="color:#101094; font-family:inherit">continue</span><span style="color:#303336; font-family:inherit">\n    </span><span style="color:#101094; font-family:inherit">elif</span><span style="color:#303336; font-family:inherit"> b </span><span style="color:#303336; font-family:inherit">==</span><span style="color:#303336; font-family:inherit"> a </span><span style="color:#303336; font-family:inherit">:</span><span style="color:#303336; font-family:inherit">\n        </span><span style="color:#101094; font-family:inherit">print</span><span style="color:#303336; font-family:inherit">(</span><span style="color:#7d2727; font-family:inherit">"Duplicate numbers. Please re-enter."</span><span style="color:#303336; font-family:inherit">)</span><span style="color:#303336; font-family:inherit">\n        </span><span style="color:#101094; font-family:inherit">continue</span><span style="color:#303336; font-family:inherit">\n    </span><span style="color:#101094; font-family:inherit">elif</span><span style="color:#303336; font-family:inherit"> b </span><span style="color:#303336; font-family:inherit">&lt;</span><span style="color:#303336; font-family:inherit"> </span><span style="color:#7d2727; font-family:inherit">46</span><span style="color:#303336; font-family:inherit"> </span><span style="color:#303336; font-family:inherit">:</span><span style="color:#303336; font-family:inherit">\n        </span><span style="color:#101094; font-family:inherit">break</span><span style="color:#303336; font-family:inherit">\n    </span><span style="color:#101094; font-family:inherit">print</span><span style="color:#303336; font-family:inherit">(</span><span style="color:#